import React from "react";
import styled from "styled-components";
// import {profile} from '../assets/profile.webp'
import data from "../data.json"
const Contactinfos = () => {
  return (
    <Container>
        <div>
      <div className="imgDiv">{/* <img src="../assets/background.jpg" alt="" /> */}</div>{" "}
      <div>
      
        <ul>  <p className="nameHeader"> Jamila Israfilzadeh</p>
          <li>Phone:</li>
          {data.fullName}
          <li>Eamil:</li>
          {data.email}
          <li>Portfolio:</li>
          {data.portfolio}
          <li>LinkedIn:</li>
          {data.linkedin}
          <li>Date of birth:</li>
           
        </ul>
      </div></div>
    </Container>
  );
};

export default Contactinfos;

const Container = styled.div`
display: flex;
align-items: center;
margin: 0 auto;
padding: 5%;
justify-content: center;
  /* background-image: url("../assets/background.jpg"); */
  background-color: #5f00f72d;
  div{
      border: 1px solid grey;
  }
  .imgDiv{
      width: 300px;
    border: 1px solid grey;
      height: 500px;
  }
  .nameHeader{
      font-size: 25px;
      font-weight: 400;
  
      
  }
  ul {
    list-style: none;
    text-align: left;
  }
  ul>li{
     padding : 5px;
  }
`;
